import './Card.css'

const Card = (itemProps) => {
    // this is needed to obtain all other classes between wherever <card> is used
    const classes = 'card ' + itemProps.className
    // CHILDREN will always represent the values between <>
    return (
        <div className={classes}>{itemProps.children}</div>
    )
}

export default Card
